import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import { robots } from './robots';

ReactDOM.render(
	<div>
	<Card username={robots[0].email} id={robots[0].id} name={robots[0].name} email={robots[0].email}/>
	<Card username={robots[1].email} id={robots[1].id} name={robots[1].name} email={robots[1].email}/>
	<Card username={robots[2].email} id={robots[2].id} name={robots[2].name} email={robots[2].email}/>
	<Card username={robots[3].email} id={robots[3].id} name={robots[3].name} email={robots[3].email}/>
	<Card username={robots[4].email} id={robots[4].id} name={robots[4].name} email={robots[4].email}/>
	<Card username={robots[5].email} id={robots[5].id} name={robots[5].name} email={robots[5].email}/>
	</div>
	, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
